import ReactDom from "react-dom";
// import App from './App';
// import './App.css';

function greeting(name) {
  const date = new Date();
  const hours = 19;

  let timeOfDay;
  if (hours >= 4 && hours < 12) {
    timeOfDay = "morning";
  } else if (hours >= 12 && hours < 17) {
    timeOfDay = "afternoon";
  } else if (hours >= 17 && hours < 20) {
    timeOfDay = "evening";
  } else {
    timeOfDay = "night";
  }

  return `Good ${timeOfDay}, ${name} !`;
}

greeting("Le Roy");

ReactDom.render(<h1>{greeting()}</h1>, document.getElementById("root"));
